    function collectFee(address account, uint amount, uint256 rate) private returns (uint256) {
        
      
        
        uint256 devFee = amount.mul(_devFee).div(10000);
        uint256 burnFee = amount.mul(_burnFee).div(10000);
        

        //@dev Dev fee
        if(devFee > 0){
            amount = amount.sub(devFee);
            _reflectionBalance[devAddress] = _reflectionBalance[devAddress].add(devFee.mul(rate));
            _devFeeTotal = _devFeeTotal.add(devFee);
            emit Transfer(account,devAddress,devFee);
        }
        //@dev burn fee
        if(burnFee > 0){
            amount = amount.sub(burnFee);
            _reflectionBalance[burnAddress] = _reflectionBalance[burnAddress].add(burnFee.mul(rate));
            _burnFeeTotal = _burnFeeTotal.add(burnFee);
            emit Transfer(account,burnAddress,burnFee);
        }
        
        
        return amount;
    }

    function _getReflectionRate() private view returns (uint256) {
        uint256 reflectionSupply = _reflectionTotal;
        uint256 tokenSupply = _tokenTotal;
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (
                _reflectionBalance[_excluded[i]] > reflectionSupply ||
                _tokenBalance[_excluded[i]] > tokenSupply
            ) return _reflectionTotal.div(_tokenTotal);
            reflectionSupply = reflectionSupply.sub(
                _reflectionBalance[_excluded[i]]
            );
            tokenSupply = tokenSupply.sub(_tokenBalance[_excluded[i]]);
        }
        if (reflectionSupply < _reflectionTotal.div(_tokenTotal))
            return _reflectionTotal.div(_tokenTotal);
        return reflectionSupply.div(tokenSupply);
    }
    
    
    function ExcludedFromFee(address account, bool) public onlyOwner {
        isExcludedFromFee[account] = true;
    }
    
    function IncludeFromFee(address account, bool) public onlyOwner {
        isExcludedFromFee[account] = false;
